import './App.css';
import Login from './Pages/login/LoginPage';
import { Typography } from '@mui/material';

function App() {
  return (
    <div className="App">
      <div className='app-title-div'>
        <Typography variant='h2' className='app-name'>Quizaroo</Typography>
      </div>
      <Login />
    </div>
  );
}

export default App;
